window.bookSummaryJSON = "<p><b>While war rages in Thameland, other battles begin.</b></p> <p><b>With his first year complete, Alex Roth has made a discovery that could change his kingdom forever.</b></p> <p>As the university prepares for an expedition to Thameland, Alex makes himself ready by growing stronger, taking summer courses on magic and spending time with his new friends and family.</p> <p>But conspiracy brews in Generasi. Demonic attacks target the expedition, and as the city prepares for its annual Games of Roal, Alex must make sure that his own secrets donâ€™t come back to bite him.</p> <p>At least he has family and a new relationship to calm his nerves.</p> <p>Until an unexpected visit throws his whole summer into disarray.</p> <p>There is no rest for the wicked. Or foolish.</p> <p>In the third book of the best-selling series, continue your fantastical journey into a coming-of-age magic-academy fantasy with a weak-to-strong progression into power, a setting inspired by D&amp;D, detailed world-building, and magical science, action, comedy, slice-of-life, and GameLit elements.</p>"; 
